import React from "react";

import NavBarItem from "./NavBarItem";
import "./Home.css";

const Home = () => {
  return (
    <div>
      <h1>Home Page</h1>
      <header className="header">
        <div>
          <h2>Booking Website</h2>
          <div>
            <button>Register</button>
            <button>Login</button>
          </div>
        </div>

        <NavBarItem />
      </header>
    </div>
  );
};

export default Home;
